CREATE OR REPLACE FUNCTION public.gerardireitoacesso(idgrupo integer)
  RETURNS boolean AS
$BODY$
declare 
	tacao telaacao%rowtype;
	direito direitogrupo%rowtype;
begin
	for tacao in select ta.* from tela t inner join telaacao ta on t.id = ta.idtela where t.ativo = true and t.deletado = false
	loop
		select * into direito from direitogrupo dg where dg.idacao = tacao.idacao and dg.idtela = tacao.idtela and dg.idgrupousuario = idgrupo;
		if direito is null then
		end if;
		
	end loop;
	return true;
end
$BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

